import React from "react";
import { API } from "../config";
import SingleSource from "./SingleSource";



const ShowImage2 = ({ item, url }) => (
  <div className="product-img" style={{ height: "250px",width:25 }}>
    
      <SingleSource
        src={`${API}/${url}/image/${item._id}`}
        alt={item.name}
      className="mb-3"
     
        style={{
          objectFit: "contain",
          height: "100%",
          width: "100%",
          display: "flex",
          marginLeft: "auto",
          marginRight: "auto",
        }}
        
       
      />
   
   
  </div>
);

export default ShowImage2;
